import React, { Component } from "react";

class createUser extends Component {
    constructor(props) {
        super(props)

        this.state = {
            username:''
        }

    }

    onUsernameChange = (e) => {
        this.setState({
            username:e.taget.value
        })
    }

    onSubmit = () => {
        e.preventDefault()

        const user = {
            username: this.state.username
        }

        console.log(user)

        this.setState({
            username: ''
        })
    }


  render() {
    return (
      <div className=''>
        <div>createUser</div>
        <form onSubmit={this.onSubmit()}>
          <label>Username</label>
          <input></input>
        </form>
      </div>
    );
  }
}

export default createUser;
